import axios from 'axios'

const paul="http://localhost:8080";

export const link=async(obj)=>{
   const hello=await axios.post(`${paul}/fresh`,obj)
   return hello;
}

export const gather=async()=>{
   const yet=await axios.get(`${paul}/home`)
   return yet;
}
